Dear Diary (Robby D, Digital Playground / 2013)

Flirty Casey Calert is moving, and she wants to record the milestone in a video diary. While packing up, she tries to catch her roommate, Rilynn Rae, fucking her boyfriend on camera but Rilynn ends up having sex with Casey instead. Casey's goodbye kiss with former roommate Danny Mountain turns into something much steamier. Before she even has a chance to unpack, Casey's roommate Bibi Jones 'borrows' the camera to film a sex tape with her boyfriend James Deen. Bibi hands the camera off the Jesse Jane who does the same with her boyfriend Michael Vegas. Finally Chad White returns the camera to Casey, sparking the attractive pair to make some new memories!

